import React from 'react';

export default function MalfunctionList(props) {
  const malfunctionItems = props.history.map((item, index) => {
    return (
      <tr key={index}>
        <td>{item.code}</td>
        <td>{item.description}</td>
        <td>{item.time}</td>
        <td>{item.cost}</td>
      </tr>
    );
  });

  return (
    <table>
      <thead>
        <tr>
          <td colspan={4}>Repair History</td>
        </tr>
        <tr>
          <td>Code</td>
          <td>Description</td>
          <td>Time</td>
          <td>Price</td>
        </tr>
      </thead>
      <tbody>{malfunctionItems}</tbody>
    </table>
  );
}
